import TextField from '@mui/material/TextField';
import { styled } from '@mui/material/styles';
import theme from "../../components/UI/Theme";
import Button from '@mui/material/Button';

const InputTextField = styled(TextField)({
  '& label.Mui-focused': {
    color: theme.palette.common.lightBlue,
  },
  "&:hover label": {
    color: theme.palette.common.lightBlue
  },
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: 'white',
    },
    '&:hover fieldset': {
      borderColor: theme.palette.common.lightBlue,
    },
    '&.Mui-focused fieldset': {
      borderColor: theme.palette.common.lightBlue,
    },
  }
});

const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none",
  width: "28%",
  marginTop: "5%",
  [theme.breakpoints.down("md")]: {
    width: "100%",
    marginRight: "0px",
    marginBottom: "16px"
  }
})

const Login = () => {
return (
  <form>
    <div class="container">
      <h1>Log in to Fintechport</h1>
      <InputTextField required fullWidth id="name" label="Enter Username" variant="filled" size="small"/>
      <InputTextField required fullWidth id="password" label="Enter Password" variant="filled" size="small"/>
      <ContainedButton variant="contained" color="secondary">Log In</ContainedButton>
    </div>
    <div class="container">
      <p>Or Sign Up using</p>
      <button type="button" class="cancelbtn">Sign Up</button>
      <span class="psw">Forgot <a href="#">password?</a></span>
    </div>
</form>
)
};

export default Login;
